  null\n\t}],\n\t\"num_resources\": 2,\n\t\"tags\": [],\n\t\"title\": \"Coral Reef
  Ecosystem Data from the 2010-2011 Kahekili Herbivore Fisheries Management Area,
  West Maui, Herbivore Enhancement as a Tool for Reef Restoration Project (NODC Accession
  0082869)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-09-26T21:48:35.605819\",\n\t\"name\":
  \"coral-reef-ecosystem-data-from-the-2010-2011-kahekili-herbivore-fisheries-management-area-west-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This research targets the Hawaii Coral
  Reef Initiative (HCRI) Priority Area A: Kahekili, Maui: Herbivore Fisheries Management
  Area (KHFMA). The project goal was to evaluate the efficacy of this new management
  action by developing a detailed algal production/herbivore consumption budget. The
  KHFMA was established in an effort to promote herbivore grazing and thus reverse
  the decline in coral cover on the reef through increased algal consumption. Because
  it may take several years for monitoring programs of fish and benthic communities
  to detect changes associated with the recent protection from fishing at KHFMA, additional
  data are needed to identify benchmarks of success. By developing a growth/consumption
  budget for the algal and herbivore communities at KHFMA, this will enable the determination
  how much algae is currently being grazed and how many more herbivores would be needed
  to actually begin controlling algal abundance at Kahekili. Observations of fish
  and urchin consumption of algae were made during 2010-2011 at KHFMA. Additional
  observations were made at Lanai Lighthouse, which is the SW corner of the island
  of Lanai and Canoe Beach, which is just south of KHFMA, in 2009. Laboratory experiments
  were conducted at the Maui Ocean Center in 2010-2011.\",\n\t\"license_title\": null,\n\t\"extras\":
